import { Component } from '@angular/core';

@Component({
  selector: 'app-authorlist',
  templateUrl: './authorlist.component.html',
  styleUrls: ['./authorlist.component.css']
})
export class AuthorlistComponent {
  displayedColumns: string[] = ['position', 'name', 'weight', 'symbol'];

}
<div class="booklist">
    <div class ="Id"> Id : {{book.id}}</div>
    <div class = "Title"> Book : {{ book.title }}</div>
    <div class = "Price"> Price : {{ book.price | currency:'USD'}}  </div>
    <div class = "Author"> Author : {{ book.authorName }} </div>
    <div class = "AuthorBio"> Author Bio : {{ book.authorBio }}</div>
</div>
